				className="HomePage_img_clown"
				src="https://img.bfmtv.com/c/1256/708/e9a/af23a9e39d545d7e0973b6fc1d085.png"
			/>
            <div className="HomePage_glitch">
				<div class="glitch" data-text="WILD_CIRCUS">

				</div>
				<div class="glow">WILD_CIRCUS</div>
				<div class="scanlines" />
